import React, { Component } from "react";
import "materialize-css/dist/css/materialize.min.css";
import M from "materialize-css/dist/js/materialize.min.js";

class BroodjeMenu extends Component {
  state = {};

  componentDidMount() {
    M.AutoInit();
  }

  render() {
    const { broodje } = this.props;
    const menuList = broodje.map(broodje => {
      return (
        <div className="broodjeMenu">
          <option value="1">{broodje.broodSoort}</option>
          <option value="1">{broodje.boter}</option>
          <option value="1">{broodje.beleg}</option>
        </div>
      );
    });
    console.log(broodje);
    return (
      <div className="container">
        <div className="input-field col s12">
          <select defaultValue="">
            <option value="" disabled>
              Broodsoort
            </option>
            <option value="1">Witte Bol</option>
            <option value="2">Bruine Bol</option>
            <option value="3">Witte Boterham</option>
            <option value="4">Bruine Boterham</option>
            <option value="5">Krentenbol</option>
            <option value="6">Zuurdesem</option>
            <option value="6">Geen</option>
          </select>
        </div>
      </div>
    );
  }
}

export default BroodjeMenu;
